def _cython_agg_blocks(
    self, how: str, alt=None, numeric_only: bool = True, min_count: int = -1
) -> "Tuple[List[Block], Index]":
    data: BlockManager = self._get_data_to_aggregate()

    if numeric_only:
        data = data.get_numeric_data(copy=False)

    agg_blocks: List[Block] = []
    new_items: List[np.ndarray] = []

    for block in data.blocks:
        locs = block.mgr_locs.as_array
        result = block.values  # Get the values
        dtype = block.dtype  # Get the dtype
        if dtype == 'Int64' and how in ['mean', 'median', 'var']:
            result = result.astype(float)  # Cast to float for calculations
        else:
            result = result.astype(dtype)  # Cast back to the original dtype

        # Perform aggregation operations
        if how == 'mean':
            result = result.mean(axis=1, skipna=True)
        elif how == 'var':
            result = result.var(axis=1, ddof=1, skipna=True)
        elif how == 'median':
            result = np.median(result, axis=1)

        # Create a new Block with the calculated result
        agg_block: Block = block.make_block(result)
        new_items.append(locs)
        agg_blocks.append(agg_block)

    return agg_blocks, data.items.take(np.concatenate(new_items))
